import React from 'react';
import { Button } from '../Button/';

export interface MainProps {
  data: any;
}

const Main: React.SFC<MainProps> = ({ data }) => {
  return (
    <div className="col p-2">
      <h2>Dashboard - {data.getGlobalConfig.businessName}</h2>
      <p>Welcome back {data.getGlobalConfig.fullName}!</p>
      <Button
        submitPrice={() => alert('Add Product clicked!')}
        updatePrice={2}
        query=""
        price={1}
        mutateLoading={true}
      >
        Add Product
      </Button>
      <table className="table table-borderless">
        <thead>
          <tr>
            <th scope="col">Product</th>
            <th scope="col">Price</th>
            <th scope="col">Image</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Pokemon Shirt</td>
            <td>$10</td>
            <td>
              <img src="https://picsum.photos/50/50" />
            </td>
          </tr>
          <tr>
            <td>Lava Lamp</td>
            <td>$1</td>
            <td>
              <img src="https://picsum.photos/50/50" />
            </td>
          </tr>
          <tr>
            <td>Friends (BluRay)</td>
            <td>$5</td>
            <td>
              <img src="https://picsum.photos/50/50" />
            </td>
          </tr>
        </tbody>
      </table>
      <style jsx>{`
        td {
          verticle-align: middle !important;
        }
      `}</style>
    </div>
  );
};

export default Main;
